import styled from "styled-components";

const ProgressBar = styled.div`
    position: absolute;
    background: linear-gradient(0deg, rgba(34,193,195,1) 0%, rgba(253,187,45,1) 100%);
    height: 100%;
    width: 25%;
    left: 0;


`;

export default ProgressBar;
